              this.myToken = token ? token : ''; //   null  undefined\n            }\n   }\n\n\n\n  addProductToWishList(id:string ):Observable{\n\n    return this.httpClient.post(`${environment.baseUrl}/api/v1/wishlist`,\n      {\n        \"productId\": id\n    }\n    // ,{\n    //   headers:{\n    //     token:this.myToken\n    //   }\n      \n    // }\n  );\n  }\n  removeProductFromWishList(id:string):Observable{\n    return this.httpClient.delete(`${environment.baseUrl}/api/v1/wishlist/${id}`,\n      // {\n      //   headers:{\n      //     token:this.myToken\n      //   }\n        \n      // }\n    )\n  }\n\n\n  getLoggedWishList():Observable{\n    return this.httpClient.get(`${environment.baseUrl}/api/v1/wishlist`,\n      // {\n      //   headers:{\n      //     token:this.myToken\n      //   }\n        \n      // }\n    )\n  }\n\n\n\n\n\n\n\n\n\n\n\n\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n        \n            \n                \n                src/app/app.component.ts\n            \n            component\n            AppComponent\n            \n                0 %\n                (0/3)\n            \n        \n        \n            \n                \n                        src/app/app.config.server.ts\n            \n            variable\n            config\n            \n                0 %\n                (0/1)\n            \n        \n        \n            \n                \n                        src/app/app.config.server.ts\n            \n            variable\n            serverConfig\n            \n                0